import logo from './logo.svg';
import './App.css';
import Spline from '@splinetool/react-spline';
import Navbar from './components/navigation';
import About from './pages/about';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <div className='background'>
        <div className='intro'>
          <h1>Hello...</h1>
        </div>
      <Spline className='spline' scene="https://prod.spline.design/8RrOVlUe2NzEiH6L/scene.splinecode" />

      </div>
      <About/>
    </div>
  );
}

export default App;
